import React, {Component, Fragment} from "react";
import { Col, Container, Row } from "react-bootstrap";
import Caall from '../../asset/img/icon/call.png';
import Man from '../../asset/img/icon/man.png';
import Send from '../../asset/img/icon/send.png';

class Services extends Component{
    render(){
        return(
            <Fragment>
                <Container>
                   <Row className="text-center">
                       <h1><ins>Service Section.</ins></h1>
                       <Col lg={4} md={6} sm={12}>
                           <div>
                               <img src={Caall}/>
                           </div>
                       </Col>
                       <Col lg={4} md={6} sm={12}>
                            <div>
                               <img src={Man}/>
                           </div>
                       </Col>
                       <Col lg={4} md={6} sm={12}>
                           <div>
                               <img src={Send}/>
                           </div>
                       </Col>
                   </Row>
                </Container>
            </Fragment>
        )
    }
}
export default Services;
